Documentary filmmaker Mehrdad Oskouei considers the epidemic of nose jobs in contemporary Iran, the world leader in rhinoplasty with an estimated 60,000 to 70,000 operations each year. In a country that discourages personal expression and disdains Western culture, young Iranians eagerly change their noses to model images in European and American fashion magazines. With a light touch, Oskouei listens to patients and surgeons comment on this enigmatic phenomenon. &quot;A surprising, compulsively watchable documentary&quot; - Variety.
